var tipuesearch = {"pages": [{'title': 'About', 'text': 'cmsite: wcms use  https://github.com/mdecycu/cmsimde  as submodule \n 倉儲: https://github.com/mdecad2022/site-BX41023132 \n 網頁: https://mdecad2022.github.io/site-BX41023132/content/index.html \n \n', 'tags': '', 'url': 'About.html'}, {'title': 'Brython', 'text': 'https://en.wikipedia.org/wiki/Python_(programming_language) \n Examples: \n https://gist.github.com/mdecycu/d9082d678096bd58378d6afe2c7fa05d \n https://www.geeksforgeeks.org/python-programming-examples/ \n https://www.programiz.com/python-programming/examples \n https://www.freecodecamp.org/news/python-code-examples-sample-script-coding-tutorial-for-beginners/ \n Python Tutorial: \n https://docs.python.org/3/tutorial/ \n An informal introduction to Python \n Indentation \n Variables \n Comments \n Numbers \n Strings \n print \n Python control flow tools \n for \n if \n range \n open \n read \n lists \n tuples \n dictionaries \n functions \n try ... except \n break \n pass \n classes \n 這個頁面 demo 如何在同一頁面下納入多個線上 Ace 編輯器與執行按鈕 ( practice_html.txt  動態頁面超文件). \n practice_html.txt  動態頁面超文件應該可以在啟動 Brython 時, 設定將 .py 檔案放入 downloads/py 目錄中引用. \n 亦即將所有對應的 html 也使用 Brython 產生, 然後寫為  class  後, 在範例導入時透過  instance  引用. \n <!-- 啟動 Brython -->\n<script>\nwindow.onload=function(){\nbrython({debug:1, pythonpath:[\'./../cmsimde/static/\',\'./../downloads/py/\']});\n}\n</script> \n 從 1 累加到 100: \n 1 add to 100 \n 將 iterable 與 iterator  相關說明 , 利用 Brython 與 Ace Editor 整理在這個頁面. \n  導入 brython 程式庫  \n \n \n \n \n  啟動 Brython  \n \n \n \n  導入 FileSaver 與 filereader  \n \n \n \n \n  導入 ace  \n \n \n \n \n \n \n  導入 gearUtils-0.9.js Cango 齒輪繪圖程式庫  \n \n \n \n \n \n \n  請注意, 這裡使用 Javascript 將 localStorage["kw_py_src1"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n \n \n \n  add 1 to 100 開始  \n \n \n  add 1 to 100 結束 \n  editor1 開始  \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  \n Filename:  .py   \n  存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div1 作為切入位置  \n \n  editor1 結束   ##########################################  \n 從 1 累加到 100 part2: \n 1 add to 100 cango_three_gears BSnake AI Tetris \n  請注意, 這裡使用 Javascript 將 localStorage["kw_py_src2"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  add 1 to 100 part2 開始  \n \n \n  add 1 to 100 part2 結束 \n  editor2 開始  \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  \n Filename:  .py   \n  存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div1 作為切入位置  \n \n  editor2 結束  \n', 'tags': '', 'url': 'Brython.html'}, {'title': 'HW', 'text': '', 'tags': '', 'url': 'HW.html'}, {'title': 'w2', 'text': '1.建立41023132@nfu.edu.tw Microsoft帳號 \n 2.建立replit個人帳號 \n 3.建立one shape個人帳號 \n', 'tags': '', 'url': 'w2.html'}, {'title': 'w3', 'text': '\n 透過\xa0\xa0 mdecad2022\xa0\xa0 的 organization 建立個人可以管理的倉儲 (site-Github_帳號) \xa0 \n 利用\xa0\xa0 replit 帳號所啟動的動態網站進行內容管理 \xa0 \n 動態轉為靜態網站內容之後,\xa0\xa0 要設法與 Github 倉儲同步 \n 雲端版 \xa0 \n 登入 github (靜態網站) \xa0 \n 登入 replit (雲端動態網站) \xa0 \n 登入 \xa0 https://mail.nfu.edu.tw \xa0 (學號@nfu.edu.tw) \xa0 \n 登入 Onedrive (需要 5TB 儲存資料, Teams 與 Meet 上課) \xa0 \n 登入 Onshape (可以在平板與手機上繪製或檢視零組件) \xa0 \n ----- \xa0 \n 近端版 \xa0 \n Siemens NX 2027 (高階 MCAD) \xa0 \n Solvespace (有原始碼的參數式繪圖軟體) \xa0 \n CoppeliaSim \xa0 \n 可攜 Python \xa0 \n 可攜 MSYS1 \xa0 \n PC, Notebook \xa0 \xa0\xa0 \xa0 \n \n \n', 'tags': '', 'url': 'w3.html'}, {'title': 'w4', 'text': '近端工具: 下載\xa0\xa0 \xa0 portable_python_3.10.6.7z \xa0 \n 雲端工具: Replit \xa0 \n 電腦輔助繪圖工具:\xa0 \xa0 \n \xa0\xa0\xa0 近端 NX2027 與 Solvespace \xa0 \n \xa0\xa0\xa0 雲端: \xa0 https://onshape.com \xa0 \xa0 \n 登入 Github \xa0 \n 登入 Replit \xa0 \n 登入 Onedrive ,\xa0 \xa0 \n 考試網站: https://exam.cycu.org \xa0 \xa0 \n', 'tags': '', 'url': 'w4.html'}, {'title': 'w5', 'text': '在一台遠端 server, 執行個人倉儲的動態網頁。 \n \n Login to \xa0 https://mail.nfu.edu.tw \xa0，查看登入 stud.cycu.org 伺服器的帳號密碼, 帳號為 cad+學號, 密碼為四個字元, 包括數字與小寫英文字母 \xa0 * 帳號:cad41023132；密碼:6hxa 。 \n 近端 給 127.0.0.1 使用 "9157" ； 遠端 給 stud.cycu.org 使用 "8157" 。 \xa0 \n 修改可攜 Python 3.10.6 start.bat, 蓋掉第三行後重新啟動, 目的希望將操作系統的命令搜尋路徑放在可攜目錄搜尋路徑之後. \xa0 \n 重新啟動可攜程式環境, 在其中一個命令列,  ssh\xa0\xa0 cad+學號@stud.cycu.org , 表示要使用 secure shell 遠端登入到 stud.cycu.org, 這是一台 Linux 主機, 安裝 Ubuntu 22.04 Server.(若使用的網路連線協定並無 IPv6,\xa0 可將系統的 proxy 設為 140.130.17.4:3128 kmolab/kmolab) \xa0 \n 在 ssh 登入畫面, 以 ssh-keygen 建立 key pairs, .ssh/id_rsa 為 private key, id_rsa.pub 為 public key \xa0 \n 設法利用 Filezilla, 以 sftp 安全的(Secure)檔案(File)傳輸(Transmission)協定(Protocol), 與 stud.cycu.org 伺服器連結. \xa0 \n 利用\xa0 Filezilla sftp 取下 id_rsa.pub, 登錄至 Github 帳號下的 Setting - >\xa0 SSH and GPG keys. \xa0 \n 對\xa0 server sftp 也可以利用\xa0 \xa0 Filezilla portable , 以圖形介面完成. 而 ssh 也可以透過\xa0 putty.exe 執行遠端登入. \xa0 \n 接下來要下載\xa0 \xa0 config \xa0 設定檔案,\xa0 以 sftp 放入 stud.cycu.org 主機的 .ssh 目錄中. \xa0 \n 接下來要在\xa0 Ubuntu (也就是 stud.cycu.org 這台主機所安裝的操作系統) 中, 設定 .gitconfig, 總共包含三項設定: git config --global user.name "scrum-1", git config --global user.email\xa0 "scrum1@mde.tw"\xa0\xa0 以及 git config --global http.proxy http://p42.cycu.org:3128, 這三個設定必須在 ssh 登入畫面中執行, 設定完成檔案會存入帳號根目錄中的 .gitconfig \xa0 \n 利用\xa0 git clone --recurse-submodules\xa0 \xa0 git@demo:mdecad2022/site-scrum-1.git \xa0 demo \xa0 \n 接著下載 \xa0 server.py , 在 Windows 編輯 \xa0 server.py , 將個人分配到的 9xxxx 埠號填入後存檔, 以 sftp 放入上列取下的倉儲根目錄. \xa0 \n \n 若要開啟網站，先輸ssh  cad41023132@stud.cycu.org ；再輸密碼:6hxa。 \n 完成後打" cd BX "，再輸" python3 server.py "。 \n http://stud.cycu.org:8157 \n', 'tags': '', 'url': 'w5.html'}, {'title': 'w6', 'text': '影片 \n \n', 'tags': '', 'url': 'w6.html'}, {'title': 'w7', 'text': '\n 網路設定與可攜程式系統_雙網路協定 \n \n \n \n \n \n \n 利用批次檔案、登錄設定檔案與 powershell 程式設定電腦輔助設計室專用 IPv6 網路協定環境設定 \n \xa0cp2022_w7_cadlab_network_setup.7z 下載  \n portable_python_3.10.6_w7.7z \n \n \n \n \n \n 靜態登入成功 \n', 'tags': '', 'url': 'w7.html'}, {'title': 'w8', 'text': '\n', 'tags': '', 'url': 'w8.html'}, {'title': 'w9', 'text': '\n 零組件設計繪圖 \n \n \n \n 請參考  Design Day One  資料, 並根據以  STEP 242  格式轉入 NX2027 之  Drill Press 零組件檔案 各零件尺寸, 重新利用  NX2027  與  Onshape  繪製各零組件, 過程請以  Wink3  影片錄製繪圖步驟並在個人網頁中的 H1 格式, 標題為 w6 的頁面中呈現 . \n 下載 NX2027 lite 可攜版本  ( 教學影片 ) \n \xa0\xa0\xa0  Drafting a Model in NX 教學影片 \n 下載 Solvespace 3.1 版 for Windows \n 下載 CoppeliaSim 4.3.0 rev12 \n 在 Onshape 建立教育版帳號 \n \n \n 下載 server.py, acp, config 設定檔案 \n 下載 可攜的 filezilla \n \n \n \n 各學員 port 分配表 \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'w9.html'}, {'title': 'w10', 'text': '已知  block.prt  中 p8=59, p9=44, 請利用網際表單, 將 p8, p9 都改為 50 之後, 在瀏覽中提供新的 block_new.prt 檔案下載, 並直接在網頁上展示該零件的 STL 格式檔案. \n \n /downloads/block_new.stl \n', 'tags': '', 'url': 'w10.html'}, {'title': 'w11', 'text': '\n \n 建立 TCExam 題庫 \n \n \n \n \n \n \n 各分組如何建立 TCExam 線上考試系統的題庫? \n \n 啟動可攜 Python 程式系統後, 在命令列中輸入 leo, 開啟 Leo Editor. \n 下載  tcexam_network_setting_cadlab.leo , 以 Leo Editor 開啟. \n 了解如何使用 Leo Editor. \n 各組組員根據下列規劃出題: \n \n 題庫建立時間 - header 標註: \n \n \n \n \n XML \n \n \n <?xml version="1.0" encoding="UTF-8" ?>\n <tcexamquestions version="14.8.5\n ">\n <header lang="en" date="2022-11-10 14:02:11"></header>\n @others\n </tcexamquestions>\n @language xml\n @tabwidth -4 \n \n \n \n \n \n 根據命題時間, 修改上列 header 內容. \n 接下來修改題庫模組名稱 - module -name: \n \n \n \n \n XML \n \n \n <module>\n     <name>network_setting</name>\n     <enabled>true</enabled>\n     @others\n </module> \n \n \n \n \n \n module 內的 name 請改為 cp2022_ag1_w12, 表示該題目模組名稱為 cp2022 課程 a 班第一組在 w12 週所建立的題庫. \n 接下來, 修改有關題庫主題 - subject - name: \n \n \n \n \n XML \n \n \n <subject>\n <name>cadlab</name>\n <description>有關電腦輔助設計室網路相關設定</description>\n <enabled>true</enabled>\n @others\n </subject> \n \n \n \n \n \n subject 標註下的 name 表示該題庫的主題, 請將 subject 下的 name 標註內容改為 w12. 並在其下的 description 標註說明此題庫的相關測驗內容. \n 接下來則開始建立試題: \n \n \n \n \n XML \n \n \n <question>\n <enabled>true</enabled>\n <type>multiple</type>\n <difficulty>1</difficulty>\n <position></position>\n <timer>0</timer>\n <fullscreen>false</fullscreen>\n <inline_answers>false</inline_answers>\n <auto_next>false</auto_next>\n <description>請根據機械設計工程系綜一館八樓的電腦輔助設計室電腦與網路相關設定, 選出下列正確的敘述.</description>\n <explanation>在電腦輔助設計室上課時, 將網路線直接連接到系主幹, 在正常情況下, 可以得到最大的連外頻寬.</explanation>\n @others\n </question> \n \n \n \n \n \n question 標註中, 出題者僅需要將複選題的說明文字放入 description 標註中. \n 最後, 出題者需要提供 8-12 個選項, 其中必須 true 與 false 選項各半. \n 題目選項 - answer - isright - description: \n \n \n \n \n XML \n \n \n <answer>\n     <enabled>true</enabled>\n     <isright>true</isright>\n     <position></position>\n     <keyboard_key></keyboard_key>\n     <description>上課時段之所以只選用 IPv6 網路協定, 是為了取得對外網路連線最大頻寬.</description>\n     <explanation></explanation>\n </answer> \n \n \n \n 若 isright 標註中為 true 表示該 description 選項敘述正確, 若 isright 標註中為 false, 則表示該 description 選項敘述錯誤. \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'w11.html'}, {'title': 'w12', 'text': '2022 Fall 電腦輔助設計與實習到底在教甚麼? \n 電腦輔助設計包含電腦、輔助與設計等三個要素, 電腦包含軟體、硬體與介於兩者中間的所謂韌體 ( Firmware ), 而所謂"輔助" (Aided) 則指從旁協助, 最後的設計 (Design), 則泛指將使用者的需求, 依據設計者的安排與確認流程, 逐一從虛 (模擬) 邁向實體 (實現). \n', 'tags': '', 'url': 'w12.html'}, {'title': 'w13', 'text': '\n \n Solvespace\xa0 \n', 'tags': '', 'url': 'w13.html'}, {'title': 'w14', 'text': '', 'tags': '', 'url': 'w14.html'}, {'title': 'Solvespace-1', 'text': '\n \n \n   \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'Solvespace-1.html'}, {'title': 'NX', 'text': '\n \n \n   \n \n \n \n \n \n \n \n \n \n \n \n \n   \n \n \n \n \n \n \n \n \n \n \n \n \n   \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'NX.html'}, {'title': 'Onshape', 'text': '\n \n \n   \n \n \n \n \n \n \n \n \n \n   \n \n \n \n \n \n', 'tags': '', 'url': 'Onshape.html'}, {'title': 'Solvespace-2', 'text': '\n \n \n   \n \n \n \n \n', 'tags': '', 'url': 'Solvespace-2.html'}, {'title': 'w15', 'text': '\n \n \n   \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'w15.html'}, {'title': 'EXAM', 'text': 'W4_cad2a: 154.667/200.000 (77%) \n W8_cad2a: 68.000/100.000 (68%) \n W9_cad2a: 25.000/100.000 (25%) \n W10_cad2a: 20.000/100.000 (20%) \n W12_cad2a: 60.000/100.000 (60%) \n W12_2a-1: 60.000/100.000 (60%) \n W14_2a: 100.000/100.000 (100%) \n// ]]>\n\n', 'tags': '', 'url': 'EXAM.html'}]};